import React, { useState, useEffect } from 'react';
import { Card, CardHeader, CardBody, FormGroup, Form, Input, Row, Col, Button } from 'reactstrap';
import { getCuponPorId, actualizarCupon } from '../services/apiCupones';
import { useNavigate, useParams, Link } from 'react-router-dom';
import PanelHeader from 'components/PanelHeader/PanelHeader';

const EditarCupon = () => {
    const navigate = useNavigate();
    const { id } = useParams(); // Obtener el ID del cupón desde los parámetros de la URL

    const [cupon, setCupon] = useState({
        id: '',
        cuponCode: '', // Cambiado de 'codigo' a 'cuponCode'
        descripcion: '',
        descuento: 0,
    });

    useEffect(() => {
        if (id) {
            getCuponPorId(id)
                .then(response => {
                    setCupon(response.data);
                })
                .catch(error => {
                    console.error('Error al obtener el cupón:', error);
                });
        }
    }, [id]);

    const handleChange = e => {
        const { name, value } = e.target;
        setCupon(prevState => ({
            ...prevState,
            [name]: value,
        }));
    };

    const handleSubmit = e => {
        e.preventDefault();
        actualizarCupon(cupon)
            .then(response => {
                console.log('Cupón actualizado exitosamente:', response.data);
                navigate('/lista-cupones');
            })
            .catch(error => {
                console.error('Error al actualizar el cupón:', error);
            });
    };

    if (!cupon) {
        return null; // Otra lógica si cupon es indefinido o null
    }

    return (
        <>
            <PanelHeader size="sm" />
            <div className="content">
                <Row>
                    <Col md="8">
                        <Card>
                            <CardHeader>
                                <h5 className="title">Editar Cupón</h5>
                                <Link to="/admin/lista-cupones" className="btn btn-secondary btn-round btn-sm">
                                    Regresar a la Lista
                                </Link>
                            </CardHeader>
                            <CardBody>
                                <Form onSubmit={handleSubmit}>
                                    <Row>
                                        <Col className="pr-md-1" md="5">
                                            <FormGroup>
                                                <label>Código</label>
                                                <Input
                                                    type="text"
                                                    name="cuponCode" // Cambiado de 'codigo' a 'cuponCode'
                                                    value={cupon.cuponCode || ''} // Verificación de valor
                                                    onChange={handleChange}
                                                    required
                                                />
                                            </FormGroup>
                                        </Col>
                                        <Col className="px-md-1" md="7">
                                            <FormGroup>
                                                <label>Descripción</label>
                                                <Input
                                                    type="text"
                                                    name="descripcion"
                                                    value={cupon.descripcion}
                                                    onChange={handleChange}
                                                    required
                                                />
                                            </FormGroup>
                                        </Col>
                                    </Row>
                                    <Row>
                                        <Col className="pr-md-1" md="6">
                                            <FormGroup>
                                                <label>Descuento</label>
                                                <Input
                                                    type="number"
                                                    name="descuento"
                                                    value={cupon.descuento}
                                                    onChange={handleChange}
                                                    required
                                                />
                                            </FormGroup>
                                        </Col>
                                    </Row>
                                    <Button className="btn-fill" color="primary" type="submit">
                                        Guardar Cambios
                                    </Button>
                                </Form>
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </div>
        </>
    );
};

export default EditarCupon;
